  \"2016-03-17T20:52:04.417578\",\n\t\"name\": \"iowa-criminal-history-database\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This resource is designed to give the general
  public an easily accessible location to obtain Iowa criminal history data.  The
  Division of Criminal Investigation (DCI) is the state of Iowa's central repository
  for criminal history data and responsible for maintaining all Iowa fingerprint-based
  criminal history records. The criminal history database is comprised of records
  submitted to the DCI by law enforcement agencies and clerks of court throughout
  the state. Our criminal history database consists of arrest and conviction information
  for serious misdemeanors and felonies as well as some simple misdemeanors. The completeness
  of criminal history data is dependent upon the information submitted by the law
  enforcement agencies and clerks of court throughout the state of Iowa. Therefore,
  the DCI cannot guarantee or certify that a person has not, in fact, been arrested
  or convicted in Iowa.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
